import Vue from "vue";
import Vuex from 'vuex';
import axios from "axios"

Vue.use(Vuex)

import { search } from '@/api/home.js'

export default new Vuex.Store({
    state:{
        ss:'',
        searchlists:[],
    },
    mutations:{
        searchdata(state,res){
            console.log(res.data);
            state.searchlists = res.data
        },
        getsearch(state,data){
            state.ss = data
            // console.log(state.ss);
        }
    },
    actions:{
        async searchdata_time(context){
            // context.commit('searchdata',await search())
            axios({
                    method: 'GET',
                    url: 'http://127.0.0.1:3000/search',
                    params: {
                        ss:state.ss
                    }
                })
                    .then((res) => {
                        console.log(res.data);

                        // this.lists.push(res.data)
                        // console.log(this.lists[0]);
                        
                        
                    }).catch((err) => {
                        console.log(err.data);
                    });
        },
    }
})
